import React from 'react';
import resumeimage from "../../assets/resumeimage.png";
import resume from "../../assets/resume.pdf";
import iconDownload from "../../assets/iconDownload.svg"

function Resume() {

    return(
        <div class="container">
            <div class="row">
                <a href={resume} download='resume-Justin-Hanson'>iconDownload</a>
            </div>
            <div class="row">
                <div class="col">
                    <img src={resumeimage} />
                </div>
                <div class="col">
                    <img src={resumeimage} />
                </div>
            </div>
        </div>
    )
}

export default Resume;
